"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Atelectasis (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/atelectasis-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H14886583\">",
"      <span class=\"h1\">",
"       What is atelectasis?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Atelectasis is a condition that happens when part or all of a lung collapses. This means the lung does not blow up to its normal size with each breath. It can happen if something presses on the lung or blocks the air flow inside it. It can also happen if something gets stuck in the tubes that carry air to the lungs and inside the lungs. Doctors call these tubes &ldquo;airways.&rdquo;",
"     </p>",
"     <p>",
"      Atelectasis can cause breathing problems. A person with atelectasis might not get enough oxygen in his or her blood. &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H14886598\">",
"      <span class=\"h1\">",
"       What are the symptoms of atelectasis?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Atelectasis does not always cause symptoms. If it does, the symptoms can include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Breathing problems &ndash; A person with atelectasis might struggle to breathe. He or she might not be able to take a deep breath.",
"       </li>",
"       <li>",
"        Skin or lips that look blue &ndash; This can be a sign of not getting enough oxygen in the blood.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H14886613\">",
"      <span class=\"h1\">",
"       Is there a test for atelectasis?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. The doctor or nurse will do an exam and chest X-ray. This can show if part or all of a lung has collapsed. It can also show which part of the lung and how much of it collapsed.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H14886628\">",
"      <span class=\"h1\">",
"       How is atelectasis treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Treatments include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Medicines and other treatments for pneumonia or any other disease that is causing the atelectasis.",
"       </li>",
"       <li>",
"        Treatments to break up mucus in the lungs and get it out, if mucus is blocking the air flow &ndash; These can include:",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        Medicines",
"       </li>",
"       <li>",
"        A treatment called &ldquo;chest physiotherapy&rdquo; &ndash; This can help atelectasis caused by mucus stuck in the lungs. There is more than 1 way to do this. For example, a physical therapist might thump the back to loosen mucus. Other ways involve using special devices. These include a vibrating bed, a vibrating vest, and devices a person can breathe into.",
"       </li>",
"       <li>",
"        Devices to help a person cough",
"       </li>",
"       <li>",
"        Sucking mucus out of the airway",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Other treatments. These can include:",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        Oxygen &ndash; Given through a mask over the face or a tube into the nose",
"       </li>",
"       <li>",
"        Devices to help open the airway and lung &ndash; A person can wear a device that keeps the airway open called a &ldquo;continuous positive airway pressure&rdquo; (CPAP) machine.",
"       </li>",
"       <li>",
"        Surgery &ndash; If atelectasis is caused by something pressing on the lungs, such as a tumor or cyst, doctors can do surgery to take it out.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H14886643\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
