"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     <div class=\"reference\">",
"      Hawrot AC, Metry DW, Theos AJ, et al, \"Etanercept for Psoriasis in the Pediatric Population: Experience in Nine Patients,\"",
"      <i>",
"       Pediatr Dermatol",
"      </i>",
"      , 2006, 23(1):67-71.",
"      <span class=\"pubmed-id\">",
"       [PubMed",
"       <a href=\"mobipreview.htm?32/1/32790/abstract-text/16445417/pubmed\" id=\"16445417\" target=\"_blank\">",
"        16445417",
"       </a>",
"       ]",
"      </span>",
"     </div>",
"    </li>",
"    <li>",
"     <div class=\"reference\">",
"      Ilowite NT, &ldquo;Current Treatment of Juvenile Rheumatoid Arthritis,&rdquo;",
"      <i>",
"       Pediatrics",
"      </i>",
"      , 2002, 109(1):109-15.",
"      <span class=\"pubmed-id\">",
"       [PubMed",
"       <a href=\"mobipreview.htm?32/1/32790/abstract-text/11773549/pubmed\" id=\"11773549\" target=\"_blank\">",
"        11773549",
"       </a>",
"       ]",
"      </span>",
"     </div>",
"    </li>",
