var title_f32_1_32797="LV diastolic pressure volume relationship";
var content_f32_1_32797=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F59748&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F59748&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Left ventricular diastolic pressure-volume relationship in ischemia",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 323px; height: 246px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The left ventricular (LV) diastolic pressure as a function of the LV volume defines LV diastolic distensibility or compliance. With exercise and the provocation of ischemia, there is a shift of the pressure- volume curve upward, indicating a reduction in LV compliance. A relatively stiff, noncomplaint ventricle requires higher pressure to achieve filling of a given volume.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Carroll JD, Carroll EP. Herz 1991; 16:1.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
